import { connect } from 'react-redux';

import Todo from '../../../components/App/Todo';
import { getTodoList } from '../../../services/todo/actions';

const mapStateToProps = state => {
	todo: todo
}

export default connect(
	mapStateToProps,
	{ getTodoList }
)(Todo)
